            if (response.ok) {
                setProducts(json)
            }
        }



        fetchMenu()

    }, [])


    return (
        <div className="start">
                <h2>Glimcrub</h2>
                <h3>Component for login</h3>
                <div className="users">
                {products && products.map((product) => (
                    <p key={product._id}>{product.menu && product.menu.snack[0, 1, 2, 3].name}</p>
                ))}
                </div>
        </div>
    )
}

export default Start
